// components/UserModal.jsx
import React from 'react';
import PropTypes from 'prop-types';

const UserModal = ({ isOpen, isEditMode, formData, setFormData, onClose, onSubmit, validationErrors }) => {
    if (!isOpen) return null;

    return (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
            <div className="bg-white p-6 rounded shadow-lg w-[90%] sm:w-[500px]">
                <div className="flex justify-between items-center mb-4">
                    <h3 className="text-xl font-semibold">{isEditMode ? 'Edit User' : 'Create New User'}</h3>
                    <button onClick={onClose} className="text-gray-600 text-xl">&times;</button>
                </div>
                <form onSubmit={onSubmit} className="space-y-4">
                    <div>
                        <label className="block text-sm font-medium text-gray-700 mb-1">
                            <span className="text-red-500">*</span>
                            First Name
                        </label>
                        <input type="text" name="first_name" value={formData.first_name} onChange={e => setFormData({ ...formData, first_name: e.target.value })} placeholder=" please enter first name" className="w-full border p-2 rounded" />
                        {validationErrors.first_name && (
                            <p className="text-red-500 text-sm mt-1">{validationErrors.first_name}</p>
                        )}
                    </div>
                    <div>
                        <label className="block text-sm font-medium text-gray-700 mb-1">
                            <span className="text-red-500">*</span>
                            Last Name
                        </label>
                        <input type="text" name="last_name" value={formData.last_name} onChange={e => setFormData({ ...formData, last_name: e.target.value })} placeholder=" please enter last name" className="w-full border p-2 rounded" />
                        {validationErrors.last_name && (
                            <p className="text-red-500 text-sm mt-1">{validationErrors.last_name}</p>
                        )}
                    </div>
                    <div>
                        <label className="block text-sm font-medium text-gray-700 mb-1">
                            <span className="text-red-500">*</span>
                            Email
                        </label>
                        <input type="email" name="email" value={formData.email} onChange={e => setFormData({ ...formData, email: e.target.value })} placeholder=" please enter email" className="w-full border p-2 rounded" />
                        {validationErrors.email && (
                            <p className="text-red-500 text-sm mt-1">{validationErrors.email}</p>
                        )}
                    </div>
                    <div>
                        <label className="block text-sm font-medium text-gray-700 mb-1">
                            <span className="text-red-500">*</span>
                            Profile Image Link
                        </label>
                        <input type="text" name="Profile Image Link" value={formData.profile_link_image} onChange={e => setFormData({ ...formData, profile_link_image: e.target.value })} placeholder=" please enter profile image Link" className="w-full border p-2 rounded" />
                        {validationErrors.profile_link_image && (
                            <p className="text-red-500 text-sm mt-1">{validationErrors.profile_link_image}</p>
                        )}
                    </div>

                    <div className="flex justify-end mt-6 space-x-2">
                        <button type="button" onClick={onClose} className="border px-4 py-2 rounded">Cancel</button>
                        <button type="submit" className="bg-blue-500 text-white px-4 py-2 rounded">{isEditMode ? 'Update' : 'Submit'}</button>
                    </div>
                </form>
            </div>
        </div>
    );
};

UserModal.propTypes = {
    isOpen: PropTypes.bool.isRequired,
    isEditMode: PropTypes.bool.isRequired,
    formData: PropTypes.object.isRequired,
    setFormData: PropTypes.func.isRequired,
    onClose: PropTypes.func.isRequired,
    onSubmit: PropTypes.func.isRequired,
    validationErrors: PropTypes.object.isRequired,
};

export default UserModal;
